import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import profilePic from "../Images/dp.jpg";
import Box from "@material-ui/core/Box";
import Avatar from "@material-ui/core/Avatar";
import Typography from "@material-ui/core/Typography";

const useStyles = makeStyles((theme) => ({
  infoHolder: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    float: "left",
    width: "50%",
    height: 500,
    backgroundColor: "#e1f5fe",
  },

  imageHolder: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    float: "right",
    width: "50%",
    height: 500,
    backgroundColor: "#e1f5fe",
  },
  avatar: {
    width: theme.spacing(30),
    height: theme.spacing(30),
  },
  nameHolder: {
    maxWidth: "500",
    width: "100%",
  },

  name: {
    fontWeight: 400,
  },
}));

export default function Home() {
  const classes = useStyles();
  return (
    <div>
      <Box className={classes.infoHolder}>
        <Box className={classes.nameHolder}>
          <Typography variant="h3" className={classes.name} gutterBottom>
            Lim Zi Yang
          </Typography>
        </Box>
        <Box className={classes.nameHolder}>
          <Typography variant="h5" gutterBottom>
            Computer Science Student @ NUS
          </Typography>
        </Box>
      </Box>
      <Box className={classes.imageHolder}>
        <Avatar alt="Lim Zi Yang" src={profilePic} className={classes.avatar} />
      </Box>
    </div>
  );
}
